import React from "react";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import Rent from "../../pages/Rent";
import Login from "../../pages/Login";
import Registration_Customer from "../../pages/Registration_Customer";
import Registration_Rental_Agency from "../../pages/Registration_Rental_Agency";
import { useState } from "react";

import { BrowserRouter as Router, Route, Link } from "react-router-dom";

function Navbar() {
  const handleSelect = (eventKey) => alert(`selected ${eventKey}`);

  return (
    <div>
      <Nav bg="dark" variant="pills" activeKey="1" onSelect={handleSelect}>
        <Nav.Item>
          <Nav.Link as={Link} to={"/rent"}>
            Rent
          </Nav.Link>
        </Nav.Item>

        <NavDropdown title="Login" id="nav-dropdown">
          <NavDropdown.Item>
            <Nav.Link as={Link} to={"/login"}>
              {" "}
              Renter
            </Nav.Link>
          </NavDropdown.Item>

          <NavDropdown.Item>Rental Agency</NavDropdown.Item>
        </NavDropdown>

        <NavDropdown title="Register" id="nav-dropdown">
          <NavDropdown.Item>
            <Nav.Link as={Link} to={"/registration/customer"}>
              Renter
            </Nav.Link>
          </NavDropdown.Item>
          <NavDropdown.Item>
            <Nav.Link as={Link} to={"/registration/rental_agency"}>
              Rental Agency
            </Nav.Link>
          </NavDropdown.Item>
        </NavDropdown>
      </Nav>
    </div>
  );
}

export default Navbar;
